import Head from "next/head";

function About() {
	return (
		<div>
			<Head>
				<title>About Next</title>
			</Head>
			About
			<style jsx>{`
				div {
					color: red;
					background-color: pink;
					padding: 50px;
				}
			`}</style>
			;
		</div>
	);
}

export default About;
